import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import {getPropertyById, getPropertyEnums, updateProperty} from '../api/propertyService';
import "../styles/EditPropertyPage.css"
import {getClientsByManager} from "../api/ClientService";

const EditPropertyPage = () => {
    const { id } = useParams();
    const navigate = useNavigate();
    const [property, setProperty] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [enumValues, setEnumValues] = useState({
        propertyTypes: [],
        propertyLevels: [],
        statuses: []
    });
    useEffect(() => {
        const fetchEnums = async () => {
            try {
                const data = await getPropertyEnums();
                setEnumValues({
                    propertyTypes: data.propertyTypes || [],
                    propertyLevels: data.propertyLevels || [],
                    statuses: data.statuses || []
                });
            } catch (err) {
                console.error('Ошибка загрузки enum значений:', err);
            }
        };

        fetchEnums();
    }, []);

    useEffect(() => {
        const fetchProperty = async () => {
            try {
                const data = await getPropertyById(id);
                setProperty(data);
            } catch (err) {
                setError('Ошибка загрузки данных');
            } finally {
                setLoading(false);
            }
        };
        fetchProperty();
    }, [id]);

    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;

        if (name.startsWith("address.")) {
            const addressField = name.split(".")[1];
            setProperty((prev) => ({
                ...prev,
                address: {
                    ...prev.address,
                    [addressField]: type === 'checkbox' ? checked : value
                }
            }));
        } else {
            setProperty((prev) => ({
                ...prev,
                [name]: type === 'checkbox' ? checked : value
            }));
        }
    };


    const handleSubmit = async (e) => {
        e.preventDefault();
        console.log('Отправляемые данные:', property); // ✅ ЛОГ

        try {
            await updateProperty(id, property);
            alert('Недвижимость успешно обновлена');
            navigate(`/properties/${id}`);
        } catch (err) {
            alert('Ошибка при сохранении');
        }
    };

    if (loading) return <p>Загрузка...</p>;
    if (error) return <p>{error}</p>;

    return (
        <div className="edit-property-page">
            <h2>Редактирование недвижимости</h2>
            <form onSubmit={handleSubmit} className="form-grid">
                {/* Блок адреса */}
                <div className="address-group full-width">
                    <div className="form-group">
                        <label className="form-label">Город</label>
                        <input
                            type="text"
                            name="address.city"
                            value={property.address?.city || ''}
                            onChange={handleChange}
                            className="input-field"
                        />
                    </div>

                    <div className="form-group">
                        <label className="form-label">Район</label>
                        <input
                            type="text"
                            name="address.district"
                            value={property.address?.district || ''}
                            onChange={handleChange}
                            className="input-field"
                        />
                    </div>
                </div>

                {/* Основные параметры */}
                <div className="form-group">
                    <label className="form-label">Цена</label>
                    <div className="relative">
                        <input
                            type="number"
                            name="price"
                            value={property.price || 0}
                            onChange={handleChange}
                            className="input-field price-input"
                            required
                        />
                    </div>
                </div>

                <div className="form-group">
                    <label className="form-label">Комнат</label>
                    <input
                        type="number"
                        name="rooms"
                        value={property.rooms || 0}
                        onChange={handleChange}
                        className="input-field"
                        required
                    />
                </div>

                {/* Выпадающие списки */}
                <div className="form-group">
                    <label className="form-label">Уровень</label>
                    <select
                        name="propertyLevel"
                        value={property.propertyLevel}
                        onChange={handleChange}
                        className="input-field select-field"
                    >
                        {/* ... options ... */}
                    </select>
                </div>

                {/* Чекбоксы */}
                <div className="checkbox-label-group full-width">
                    <label className="checkbox-group">
                        <input
                            type="checkbox"
                            name="hasBalcony"
                            checked={property.hasBalcony || false}
                            onChange={handleChange}
                            className="checkbox-input"
                        />
                        <span className="form-label">Балкон</span>
                    </label>

                    <label className="checkbox-group">
                        <input
                            type="checkbox"
                            name="allowPets"
                            checked={property.allowPets || false}
                            onChange={handleChange}
                            className="checkbox-input"
                        />
                        <span className="form-label">Животные</span>
                    </label>
                </div>

                <button type="submit" className="submit-btn">
                    Сохранить изменения
                </button>
            </form>
        </div>
    );
};

export default EditPropertyPage;
